import { createShop } from "../../lib/api_shop"

export const registerShop = data => {
  return async dispatch => {
    dispatch({ type: "SEND" })
    try {
      await createShop(data)
      dispatch({ type: "SUCCESS" })
    } catch (error) {
      dispatch({ type: "ERROR", payload: { errorMessage: error } })
    }
  }
}
